import React from 'react';
import { useLocation } from 'react-router';

const Order = () => {
    const info = useLocation();
    return (
        <div className="order-wrapper">
            <h1>{info.data.name}</h1>
            <h1>{info.data.price}</h1>
        </div>
    )
}

export default Order;
